description:
Verenigde Staten
Avontuur / Fantasy
94 minuten

een mooie film

met Ian McShane, Christopher Eccleston en Jonathan Jackson

Will Stanton verandert op zijn veertiende verjaardag. Hij ontdekt dat er om hem heen vreemde, onverklaarbare dingen gebeuren. 
Hij blijkt dingen te zien die de meeste mensen niet zien en hij kan door de tijd reizen. Hij is een van de Ouden, de eerste die 
in vijfhonderd jaar geboren is en ook de laatste. Hij moet zich wijden aan de strijd tussen licht en duister. Het is de taak 
van Will om zes tekens van licht op te sporen, zodat het duister overwonnen kan worden.
